(78, 'id_page', 60, '7149820d1ef7cde796f140d38b1f3da0e47a5535', 22, '<p></p><p style="margin: 0.5em 0px; line-height: 22.4px; color: rgb(37, 37, 37); font-family: sans-serif; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);"><b>Politics</b>&nbsp;(from&nbsp;<a href="https://en.wikipedia.org/wiki/Greek_language" title="Greek language" style="text-decoration: none; color: rgb(11, 0, 128); background: none;">Greek</a>:&nbsp;<span lang="grc" xml:lang="grc">πολιτικός&nbsp;<i>politikos</i></span>, definition "of, for, or relating to citizens") is the practice and theory of influencing other people. More narrowly, it refers to achieving and exercising positions of&nbsp;<a href="https://en.wikipedia.org/wiki/Governance" title="Governance" style="text-decoration: none; color: rgb(11, 0, 128); background: none;">governance</a>&nbsp;— organized control over a human community, particularly a&nbsp;<a href="https://en.wikipedia.org/wiki/State_(polity)" title="State (polity)" style="text-decoration: none; color: rgb(11, 0, 128); background: none;">state</a>. Furthermore, politics is the study or practice of the distribution of&nbsp;<a href="https://en.wikipedia.org/wiki/Power_(social_and_political)" title="Power (social and political)" style="text-decoration: none; color: rgb(11, 0, 128); background: none;">power</a>} and resources within a given community (a usually hierarchically organized population) as well as the interrelationship(s) between communities.</p><p style="margin: 0.5em 0px; line-height: 22.4px; color: rgb(37, 37, 37); font-family: sans-serif; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);">A variety of methods are employed in politics, which include promoting or forcing one''s own political views among people,&nbsp;<a href="https://en.wikipedia.org/wiki/Negotiation" title="Negotiation" style="text-decoration: none; color: rgb(11, 0, 128); background: none;">negotiation</a>with other political subjects, making&nbsp;<a href="https://en.wikipedia.org/wiki/Law" title="Law" style="text-decoration: none; color: rgb(11, 0, 128); background: none;">laws</a>, and exercising&nbsp;<a href="https://en.wikipedia.org/wiki/Force_(law)" title="Force (law)" style="text-decoration: none; color: rgb(11, 0, 128); background: none;">force</a>, including&nbsp;<a href="https://en.wikipedia.org/wiki/Warfare" title="Warfare" class="mw-redirect" style="text-decoration: none; color: rgb(11, 0, 128); background: none;">warfare</a>&nbsp;against adversaries. Politics is exercised on a wide range of social levels, from&nbsp;<a href="https://en.wikipedia.org/wiki/Clans" title="Clans" class="mw-redirect" style="text-decoration: none; color: rgb(11, 0, 128); background: none;">clans</a>&nbsp;and&nbsp;<a href="https://en.wikipedia.org/wiki/Tribes" title="Tribes" class="mw-redirect" style="text-decoration: none; color: rgb(11, 0, 128); background: none;">tribes</a>&nbsp;of traditional societies, through modern&nbsp;<a href="https://en.wikipedia.org/wiki/Local_government" title="Local government" style="text-decoration: none; color: rgb(11, 0, 128); background: none;">local governments</a>,&nbsp;<a href="https://en.wikipedia.org/wiki/Company" title="Company" style="text-decoration: none; color: rgb(11, 0, 128); background: none;">companies</a>&nbsp;and institutions up to&nbsp;<a href="https://en.wikipedia.org/wiki/Sovereign_state" title="Sovereign state" style="text-decoration: none; color: rgb(11, 0, 128); background: none;">sovereign states</a>, to the&nbsp;<a href="https://en.wikipedia.org/wiki/International_politics" title="International politics" class="mw-redirect" style="text-decoration: none; color: rgb(11, 0, 128); background: none;">international level</a>.</p><p style="margin: 0.5em 0px; line-height: 22.4px; color: rgb(37, 37, 37); font-family: sans-serif; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);">It is very often said that politics is about power.<sup id="cite_ref-Political_Geography_1-0" class="reference" style="line-height: 1; font-size: 11.2px; font-weight: normal; font-style: normal; unicode-bidi: -webkit-isolate;"><a href="https://en.wikipedia.org/wiki/Politics#cite_note-Political_Geography-1" style="text-decoration: none; color: rgb(11, 0, 128); white-space: nowrap; background: none;">[1]</a></sup>&nbsp;A&nbsp;<a href="https://en.wikipedia.org/wiki/Political_system" title="Political system" style="text-decoration: none; color: rgb(11, 0, 128); background: none;">political system</a>&nbsp;is a framework which defines acceptable political methods within a given society.&nbsp;<a href="https://en.wikipedia.org/wiki/History_of_political_thought" title="History of political thought" style="text-decoration: none; color: rgb(11, 0, 128); background: none;">History of political thought</a>&nbsp;can be traced back to early antiquity, with seminal works such as&nbsp;<a href="https://en.wikipedia.org/wiki/Plato" title="Plato" style="text-decoration: none; color: rgb(11, 0, 128); background: none;">Plato</a>''s&nbsp;<i><a href="https://en.wikipedia.org/wiki/Republic_(Plato)" title="Republic (Plato)" class="mw-redirect" style="text-decoration: none; color: rgb(11, 0, 128); background: none;">Republic</a></i>,<a href="https://en.wikipedia.org/wiki/Aristotle" title="Aristotle" style="text-decoration: none; color: rgb(11, 0, 128); background: none;">Aristotle</a>''s&nbsp;<i><a href="https://en.wikipedia.org/wiki/Politics_(Aristotle)" title="Politics (Aristotle)" style="text-decoration: none; color: rgb(11, 0, 128); background: none;">Politics</a></i>&nbsp;and the works of&nbsp;<a href="https://en.wikipedia.org/wiki/Confucius" title="Confucius" style="text-decoration: none; color: rgb(11, 0, 128); background: none;">Confucius</a>.</p><p style="margin: 0.5em 0px; line-height: 22.4px; color: rgb(37, 37, 37); font-family: sans-serif; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);">Formal Politics refers to the operation of a constitutional system of government and publicly defined institutions and procedures.<sup id="cite_ref-Political_Geography_1-1" class="reference" style="line-height: 1; font-size: 11.2px; font-weight: normal; font-style: normal; unicode-bidi: -webkit-isolate;"><a href="https://en.wikipedia.org/wiki/Politics#cite_note-Political_Geography-1" style="text-decoration: none; color: rgb(11, 0, 128); white-space: nowrap; background: none;">[1]</a></sup>Political parties, public policy or discussions about war and foreign affairs would fall under the category of Formal Politics.<sup id="cite_ref-Political_Geography_1-2" class="reference" style="line-height: 1; font-size: 11.2px; font-weight: normal; font-style: normal; unicode-bidi: -webkit-isolate;"><a href="https://en.wikipedia.org/wiki/Politics#cite_note-Political_Geography-1" style="text-decoration: none; color: rgb(11, 0, 128); white-space: nowrap; background: none;">[1]</a></sup>&nbsp;Many people view formal politics as something outside of themselves, but that can still affect their daily lives.<sup id="cite_ref-Political_Geography_1-3" class="reference" style="line-height: 1; font-size: 11.2px; font-weight: normal; font-style: normal; unicode-bidi: -webkit-isolate;"><a href="https://en.wikipedia.org/wiki/Politics#cite_note-Political_Geography-1" style="text-decoration: none; color: rgb(11, 0, 128); white-space: nowrap; background: none;">[1]</a></sup></p><p style="margin: 0.5em 0px; line-height: 22.4px; color: rgb(37, 37, 37); font-family: sans-serif; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);">Informal Politics is understood as forming alliances, exercising power and protecting and advancing particular ideas or goals. Generally, this includes anything affecting one''s daily life, such as the way an office or household is managed, or how one person or group exercises influence over another.<sup id="cite_ref-Political_Geography_1-4" class="reference" style="line-height: 1; font-size: 11.2px; font-weight: normal; font-style: normal; unicode-bidi: -webkit-isolate;"><a href="https://en.wikipedia.org/wiki/Politics#cite_note-Political_Geography-1" style="text-decoration: none; color: rgb(11, 0, 128); white-space: nowrap; background: none;">[1]</a></sup>&nbsp;Informal Politics is typically understood as everyday politics, hence the idea that "politics is everywhere".<sup id="cite_ref-Political_Geography_1-5" class="reference" style="line-height: 1; font-size: 11.2px; font-weight: normal; font-style: normal; unicode-bidi: -webkit-isolate;"><a href="https://en.wikipedia.org/wiki/Politics#cite_note-Political_Geography-1" style="text-decoration: none; color: rgb(11, 0, 128); white-space: nowrap; background: none;">[1]</a></sup></p><br><p></p>', 595940755, 'yui_3_17_2_2_1444710372005_463', 1444710441),
