(404, 'id_introeditor', 60, '99dc4f3bd7a712dc95a361d08e2d3ee2a8c4e79f', 22, '<h4 style="font-family: TimesNewRoman, ''Times New Roman'', Times; color: rgb(51, 51, 51); text-align: -webkit-center;"><span class="ds261">Syria''s Humanitarian and Diplomatic Challenge</span></h4><div id="container1" style="text-align: -webkit-center;"><div id="container2"><div id="container3"><div align="justify"><p><span class="ds170">Syrians have long struggled with many of the same challenges that have bred deep dissatisfaction in other Arab autocracies, including high unemployment, high inflation, limited upward mobility, rampant corruption, lack of political freedoms, and repressive security forces. These factors have fueled opposition to Syria’s authoritarian government, which has been dominated by the Baath (Renaissance) Party since 1963, and the Al Asad family since 1970. President Bashar al Asad’s father—Hafiz al Asad—ruled the country from 1970 until his death in 2000.</span></p><p><span class="ds170">The Syrian population, like those of several other Middle East countries, includes different ethnic and religious groups. Under the Asad regime strict political controls have prevented these differences from playing a divisive role in political or social life. A majority of Syrians, roughly 90% of the population, are ethnic Arabs; however, the country contains small ethnic minorities, notably Kurds. Of more importance in Syria are religious sectarian differences. In addition to the majority Sunni Muslims, who comprise over 70% of the population, Syria contains several religious sectarian minorities, including three smaller Muslim sects (Alawites, Druze, and Ismailis) and several Christian denominations.&nbsp;</span></p><p><span class="ds170">Despite the secular nature of the ruling Baath party, religious sects have been important to some Syrians as symbols of group identity and determinants of political orientation. The Asad family are members of the minority Alawite sect (estimated 12% of the population), which has its roots in Shiite Islam. They and the Baath party have cultivated Alawites as a key base of support, and elite security forces have long been led by Alawites. The government violently suppressed an armed uprising led by the Muslim Brotherhood in the early 1980s, killing thousands from the majority Sunni Muslim community.</span></p><p><span class="ds170">Within ethnic and sectarian communities are important tribal and familial groupings that often provide the underpinning for political alliances and commercial relationships. Socioeconomic differences abound among farmers, laborers, middle-class wage earners, public sector employees, military officials, and the political and commercial elite. Finally, local attachments shape Syrian society, as seen in rivalries between Syria’s two largest cities of Damascus and Aleppo, in differences between rural agricultural communities and urban areas, and in the concentration of s</span><span class="ds166">ome sectarian and ethnic communities in discrete areas. Despite being authoritarian, Syrian leaders have often found it necessary to adopt policies that accommodate, to some degree, various&nbsp;<a id="anchorcd060544" name="anchorcd060544"></a>power centers within the country’s diverse population and minimize the potential for communal identities to create conflict.</span></p><p align="center" style="visibility: visible;"><iframe src="http://player.vimeo.com/video/138561210" width="500" height="281" frameborder="0" webkitallowfullscreen="" mozallowfullscreen="" allowfullscreen=""></iframe></p><p align="center"><span class="ds262">Video: Historic Aleppo Under Siege</span></p><p><span class="ds170">S</span><span class="ds166">ince taking office in 2000, President Asad has offered and retracted the prospect of limited political reform, while aligning his government with Iran and non-state actors such as Hamas and Hezbollah in a complex rivalry with the United States and its Arab and non-Arab allies (including Israel). Syria’s long-standing partnership with Russia has remained intact and is now the focus of intense diplomatic attention because Russia is one of the regime’s only remaining defenders.&nbsp;</span></p><p><span class="ds166">As unrest emerged in other Arab countries in early 2011, Asad and many observers mistakenly believed that Syria’s pervasive police state and the population’s fear of sectarian violence would serve as a bulwark against the outbreak of turmoil. Limited calls in February 2011 to organize reform protests failed, but the government’s torture of children involved in an isolated incident in the southern town of Dara’a in March provided a decisive spark for the emergence of demonstrations. The use of force against demonstrators in Dara’a and later in other cities created a corresponding swell in public anger and public participation in protests. The government organized large counterdemonstrations.</span></p><p><span class="ds166">The Sunni Muslim majority has been at the forefront of the protest movement and armed opposition to the Alawite-led regime, with Syria’s Christians and other minority groups caught between their parallel fears of violent change and of being associated with Asad’s crackdown. Economic class dynamics also are influencing the choices of Syrians about the uprising: many rural, less advantaged Syrians have supported the opposition movement, while urban, wealthier Syrians appear to have more divided loyalties.</span></p><p><span class="ds166">Sectarian considerations cannot fully explain power relationships in Syria or the dynamics of the conflict. The Alawite leadership of the Syrian government and its allies in other sects perceive the mostly Sunni Arab uprising as an existential threat to the Baath party’s nearly five-decade hold on power. At the popular level, some Alawites may see their community’s fate as tied to that of the current government. Some Sunni Arabs may view the conflict as a means to assert their community’s dominance over others. Some Kurds may view the conflict as an opportunity to achieve greater autonomy. And, some Christians and other minorities may fear that their place in a future Syria is not guaranteed.</span></p><p><span class="ds166">For much of 2011 and early 2012, a cycle of tension and violence intensified, as President Asad and his government paired limited reform gestures with the use of military force against protestors and armed opposition groups. Violence was initially limited to certain locations but now has affected most major cities, including Damascus and Aleppo. Members of different elites may seek compromise with the opposition, but there has been little public dissent from top regime figures. Defections from the armed forces and from the political and business elites continue, and international sanctions and the disruptions of the conflict are creating hardship for ordinary Syrians. As the conflict has dragged on, protestors and opposition fighters have defiantly resisted government crackdowns, in spite of the arrest of thousands of citizens and documented cases of torture and regime-instigated massacres. The regime argues that opposition violence and abuses make a negotiated solution impossible, and President Asad refuses to leave power.</span></p><a id="anchorcd06033c" name="anchorcd06033c"></a><p align="center" style="visibility: visible;"><iframe src="http://player.vimeo.com/video/138561222" width="500" height="281" frameborder="0" webkitallowfullscreen="" mozallowfullscreen="" allowfullscreen=""></iframe></p><p align="center"><span class="ds262">Video: Struggling for a Diplomatic Solution</span></p><p><span class="ds170">In an Au</span><span class="ds166">g</span><span class="ds170">ust 2012 report, the United Nations Human Rights Council commission of inquiry on Syria found reasonable grounds to believe that Government forces and the Shabbiha had committed the crimes against humanity of murder and of torture, war crimes and gross violations of international human rights law and international humanitarian law, including unlawful killing, torture, arbitrary arrest and detention, sexual violence, indiscriminate attack, pillaging and destruction of property …The commission found reasonable grounds to believe that war crimes, including murder, extrajudicial execution and torture, had been perpetrated by organized anti-Government armed groups …The violations and abuses committed by anti-Government armed groups did not reach the gravity, frequency and scale of those committed by Government forces and the Shabbiha.</span></p><p><span class="ds170">The Asad government believes it can prevail, but many analysts have observed that, over time, the regime appears to be gradually losing its ability to control the country and respond to opposition provocations. Opposition forces remain relatively disorganized, but their resilience and adoption of new tactics, including the use of improvised explosive devices, have denied the government access to some regions and extended the fighting to urban areas of Damascus and Aleppo. Ongoing fighting in Aleppo and the high-profile July 18 bomb attack that killed the Syrian Defense Minister and three other senior officials have shaken Asad’s supporters, but the regime’s ferocious response and the subsequent standoffs between the Syrian military and opposition forces in Damascus and Aleppo suggest the end may not yet be in sight. The Syrian military’s use of fixed-wing aircraft to bomb rebel positions marks a new escalation, and may produce greater international outrage. International efforts to broker a cease-fire have faltered, and government and opposition forces remain engaged in all-out armed conflict with no immediate prospect of an end to fighting or a political solution.</span></p><p align="right"></p><p align="right"><span class="ds175">Congressional Research Service</span></p></div></div></div></div><div align="center"><div id="container6"><div align="center"><p></p>\n						<p></p>\n					</div>\n				\n				<p></p>\n				<p></p>\n			</div>\n		</div><p></p>', 28671455, 'yui_3_17_2_2_1451449108042_209', 1451449478),
