mmunity’s dominance over others. Some Kurds may view the conflict as an opportunity to achieve greater autonomy. And, some Christians and other minorities may fear that their place in a future Syria is not guaranteed.</span></p><p><span class="ds166">For much of 2011 and early 2012, a cycle of tension and violence intensified, as President Asad and his government paired limited reform gestures with the use of military force against protestors and armed opposition groups. Violence was initially limited to certain locations but now has affected most major cities, including Damascus and Aleppo. Members of different elites may seek compromise with the opposition, but there has been little public dissent from top regime figures. Defections from the armed forces and from the political and business elites continue, and international sanctions and the disruptions of the conflict are creating hardship for ordinary Syrians. As the conflict has dragged on, protestors and opposition fighters have defiantly resisted government crackdowns, in spite of the arrest of thousands of citizens and documented cases of torture and regime-instigated massacres. The regime argues that opposition violence and abuses make a negotiated solution impossible, and President Asad refuses to leave power.</span></p><a id="anchorcd06033c" name="anchorcd06033c"></a><p align="center" style="visibility: visible;"><iframe src="http://player.vimeo.com/video/138561222" width="500" height="281" frameborder="0" webkitallowfullscreen="" mozallowfullscreen="" allowfullscreen=""></iframe></p><p align="center"><span class="ds262">Video: Struggling for a Diplomatic Solution</span></p><p><span class="ds170">In an Au</span><span class="ds166">g</span><span class="ds170">ust 2012 report, the United Nations Human Rights Council commission of inquiry on Syria found reasonable grounds to believe that Government forces and the Shabbiha had committed the crimes against humanity of murder and of torture, war crimes and gross violations of international human rights law and international humanitarian law, including unlawful killing, torture, arbitrary arrest and detention, sexual violence, indiscriminate attack, pillaging and destruction of property …The commission found reasonable grounds to believe that war crimes, including murder, extrajudicial execution and torture, had been perpetrated by organized anti-Government armed groups …The violations and abuses committed by anti-Government armed groups did not reach the gravity, frequency and scale of those committed by Government forces and the Shabbiha.</span></p><p><span class="ds170">The Asad government believes it can prevail, but many analysts have observed that, over time, the regime appears to be gradually losing its ability to control the country and respond to opposition provocations. Opposition forces remain relatively disorganized, but their resilience and adoption of new tactics, including the use of improvised explosive devices, have denied the government access to some regions and extended the fighting to urban areas of Damascus and Aleppo. Ongoing fighting in Aleppo and the high-profile July 18 bomb attack that killed the Syrian Defense Minister and three other senior officials have shaken Asad’s supporters, but the regime’s ferocious response and the subsequent standoffs between the Syrian military and opposition forces in Damascus and Aleppo suggest the end may not yet be in sight. The Syrian military’s use of fixed-wing aircraft to bomb rebel positions marks a new escalation, and may produce greater international outrage. International efforts to broker a cease-fire have faltered, and government and opposition forces remain engaged in all-out armed conflict with no immediate prospect of an end to fighting or a political solution.</span></p><p align="right"></p><p align="right"><span class="ds175">Congressional Research Service</span></p></div></div></div></div><div align="center"><div id="container6"><div align="center