storic Aleppo Under Siege</a>&nbsp;•</span></div><div id="container18"><span class="ds343" style="text-align: left;"><br></span></div><div id="container18"><span class="ds290" style="text-align: left;">•&nbsp;<a href="#anchorcd06033c" style="outline: 0px;">Video Report: Struggling for a Diplomatic Solution</a>&nbsp;•&nbsp;</span><span class="ds290" style="text-align: left;"><a href="quizmain.html">Syria Quiz</a></span><span class="ds166" style="text-align: left;">&nbsp;</span><span class="ds337" style="text-align: left;">and</span><span class="ds166" style="text-align: left;">&nbsp;<a href="#anchord2139585">Student D</a></span><span class="ds290" style="text-align: left;"><a href="#anchord2139585" style="outline: 0px;">iscussion Board</a>&nbsp;•</span></div></div></div></div></div></div></div><div align="center"><div><div align="center"><div align="center"><div align="center"><br><img src="http://globalizationplus.com/lms/draftfile.php?file=/177/user/draft/21226371/Dictionary.gif" alt="" width="114" height="76" role="presentation" class="img-responsive"><span style="text-align: start;">&nbsp; &nbsp; &nbsp;</span><a href="dictionary/politicaldictionary.html" target="_self" style="text-align: start;"><span class="ds166">For easy reference, click here for the&nbsp;</span><span class="ds314">G</span><span class="ds166">lobalization&nbsp;</span><span class="ds314">P</span></a><span class="ds166" style="text-align: start;"><a href="dictionary/politicaldictionary.html" target="_self">lus Political Dictionary<br></a></span><b>_________________________________________________________________________________________________________________________</b></div></div><p></p></div><div align="center"><p></p>\n						<p></p>\n					</div>\n				\n				<p></p>\n				<p></p>\n			</div>\n		</div>', 21226371, 'yui_3_17_2_2_1451520095077_193', 1451520166),
