om/video/138561210" width="500" height="281" frameborder="0" webkitallowfullscreen="" mozallowfullscreen="" allowfullscreen=""></iframe></span></p><h5 style="font-family: TimesNewRoman, ''Times New Roman'', Times; color: rgb(51, 51, 51);"><span class="ds262">Video: Historic Aleppo Under Siege</span></h5><p font="" size="14" ;="" style="text-align: left;"><span class="bodytext" style="font-weight: normal;">Since taking office in 2000, President Asad has offered and retracted the prospect of limited political reform, while aligning his government with Iran and non-state actors such as Hamas and Hezbollah in a complex rivalry with the United States and its Arab and non-Arab allies (including Israel). Syria’s long-standing partnership with Russia has remained intact and is now the focus of intense diplomatic attention because Russia is one of the regime’s only remaining defenders.</span></p><p font="" size="14" ;="" style="text-align: left;"><span class="bodytext" style="font-weight: normal;">As unrest emerged in other Arab countries in early 2011, Asad and many observers mistakenly believed that Syria’s pervasive police state and the population’s fear of sectarian violence would serve as a bulwark against the outbreak of turmoil. Limited calls in February 2011 to organize reform protests failed, but the government’s torture of children involved in an isolated incident in the southern town of Dara’a in March provided a decisive spark for the emergence of demonstrations. The use of force against demonstrators in Dara’a and later in other cities created a corresponding swell in public anger and public participation in protests. The government organized large counterdemonstrations.</span></p><p style="text-align: left;"></p><p font="" size="14" ;="" style="text-align: left;"><span class="bodytext"><span style="background-color: transparent; font-weight: normal;">The Sunni Muslim majority has been at the forefront of the protest movement and armed opposition to the Alawite-led regime, with Syria’s Christians and other minority groups caught between their parallel fears of violent change and of being associated with Asad’s crackdown. Economic class dynamics also are influencing the choices of Syrians about the uprising: many rural, less advantaged Syrians have supported the opposition movement, while urban, wealthier Syrians appear to have more divided loyalties.</span></span></p><p font="" size="14" ;="" style="text-align: left;"><span class="bodytext" style="font-weight: normal;">Sectarian considerations cannot fully explain power relationships in Syria or the dynamics of the conflict. The Alawite leadership of the Syrian government and its allies in other sects perceive the mostly Sunni Arab uprising as an existential threat to the Baath party’s nearly five-decade hold on power. At the popular level, some Alawites may see their community’s fate as tied to that of the current government. Some Sunni Arabs may view the conflict as a means to assert their community’s dominance over others. Some Kurds may view the conflict as an opportunity to achieve greater autonomy. And, some Christians and other minorities may fear that their place in a future Syria is not guaranteed.</span></p><p style="text-align: left;"></p><p font="" size="14" ;="" style="text-align: left;"><span class="bodytext" style="font-weight: normal;">For much of 2011 and early 2012, a cycle of tension and violence intensified, as President Asad and his government paired limited reform gestures with the use of military force against protestors and armed opposition groups. Violence was initially limited to certain locations but now has affected most major cities, including Damascus and Aleppo. Members of different elites may seek compromise with the opposition, but there has been little public dissent from top regime figures. Defections from the armed forces and from the political and business elites continue, and international sanctions and the disruptions of the conflict are creating hardship for ordinary Syrians. As the conflict has dragged on, protestors and opposition fighters have defiantly resisted government crackdowns, in spite of the arrest of thousands of citizens and documented cases of torture and regime-instigated massacres. The regime argues that opposition violence and abuses make a negotiated solution impossible, and President Asad refuses to leave power.</span></p><p font="" size="14" ;="" style="text-align: left;"><span class="bodytext" style="font-weight: normal;"><br></span></p><p style="text-align: left;"></p><a id="anchorcd06033c" name="anchorcd06033c" style="text-align: left;"><p align="center" style="visibility: visible; font-weight: normal;"><iframe src="http://player.vimeo.com/video/138561222" width="500" height="281" frameborder="0" webkitallowfullscreen="" mozallowfullscreen="" allowfullscreen=""></iframe>&nbsp;	</p></a><h5 style="font-family: TimesNewRoman, ''Times New Roman'', Times; color: rgb(51, 51, 51);"><span class="ds262">Video: Struggling for a Diplomatic Solution</span></h5><p style="text-align: left;"><span class="ds262" style="font-weight: normal;"><br></span></p><p font="" size="14" ;="" style="text-align: left;"><span class="bodytext" style="font-weight: normal;">In an August 2012 report, the United Nations Human Rights Council commission of inquiry on Syria found reasonable grounds to believe that Government forces and the Shabbiha had committed the crimes against humanity of murder and of torture, war crimes and gross violations of international human rights law and international humanitarian law, including unlawful killing, torture, arbitrary arrest and detention, sexual violence, indiscriminate attack, pillaging and destruction of property …The commission found reasonable grounds to believe that war crimes, including murder, extrajudicial execution and torture, had been perpetrated by organized anti-Government armed groups …The violations and abuses committed by anti-Government armed groups did not reach the gravity, frequency and scale of those committed by Government forces and the Shabbiha.</span></p><p font="" size="14" ;="" style="text-align: left;"><span class="bodytext" style="font-weight: normal;">The Asad government believes it can prevail, but many analysts have observed that, over time, the regime appears to be gradually losing its ability to control the country and respond to opposition provocations. Opposition forces remain relatively disorganized, but their resilience and adoption of new tactics, including the use of improvised explosive devices, have denied the government access to some regions and extended the fighting to urban areas of Damascus and Aleppo. Ongoing fighting in Aleppo and the high-profile July 18 bomb attack that killed the Syrian Defense Minister and three other senior officials have shaken Asad’s supporters, but the regime’s ferocious response and the subsequent standoffs between the Syrian military and opposition forces in Damascus and Aleppo suggest the end may not yet be in sight. The Syrian military’s use of fixed-wing aircraft to bomb rebel positions marks a new escalation, and may produce greater international outrage. International efforts to broker a cease-fire have faltered, and government and opposition forces remain engaged in all-out armed conflict with no immediate prospect of an end to fighting or a political solution.</span></p><p style="text-align: left;"></p><p style="text-align: left;"></p><div id="container17" style="text-align: left;"></div><div id="container11"><span style="font-weight: normal;"><a id="anchorcd0608de" name="anchorcd0608de"></a><span class="ds259">____________________________________________________________________________________________________________</span></span></div></th></tr></thead></table><div align="center"><div id="container6"><div align="center"><p></p></div><div align="center"><p></p>\n						<p></p>\n					</div>\n				\n				<p></p>\n				<p></p>\n			</div>\n		</div>', 928710341, 'yui_3_17_2_2_1451520587221_453', 1451520660);
